import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Transactions = () => {
  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filter, setFilter] = useState('ALL');

  useEffect(() => {
    fetchTransactions();
  }, []);

  const fetchTransactions = async () => {
    try {
      const response = await axios.get('http://localhost:8000/api/transactions/');
      setTransactions(response.data);
    } catch (error) {
      console.error('Error fetching transactions:', error);
    } finally {
      setLoading(false);
    }
  };

  const filteredTransactions = transactions.filter(transaction => {
    if (filter === 'ALL') return true;
    return transaction.type === filter;
  });

  const getStatusColor = (amount) => {
    return parseFloat(amount) >= 0 ? 'text-green-600' : 'text-red-600';
  };

  if (loading) {
    return <div className="flex justify-center items-center h-64">Loading...</div>;
  }

  return (
    <div className="space-y-6">
      <div className="flex justify-between items-center">
        <h1 className="text-3xl font-bold text-gray-900">Transaction History</h1>

        <select
          value={filter}
          onChange={(e) => setFilter(e.target.value)}
          className="px-4 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500"
        >
          <option value="ALL">All Transactions</option>
          <option value="DEPOSIT">Deposits</option>
          <option value="WITHDRAW">Withdrawals</option>
          <option value="TRANSFER">Transfers</option>
          <option value="CONVERT">Conversions</option>
        </select>
      </div>

      <div className="bg-white shadow overflow-hidden sm:rounded-md">
        <ul className="divide-y divide-gray-200">
          {filteredTransactions.map((transaction) => (
            <li key={transaction.id}>
              <div className="px-4 py-4 sm:px-6">
                <div className="flex items-center justify-between">
                  <div className="flex items-center">
                    <div className="flex-shrink-0">
                      <span className="inline-flex items-center justify-center h-10 w-10 rounded-full bg-gray-500">
                        <span className="text-sm font-medium leading-none text-white">
                          {transaction.type.charAt(0)}
                        </span>
                      </span>
                    </div>
                    <div className="ml-4">
                      <div className="flex items-center">
                        <p className="text-sm font-medium text-gray-900">
                          {transaction.type}
                        </p>
                        {transaction.counterparty && (
                          <p className="ml-2 text-sm text-gray-500">
                            â€¢ {transaction.counterparty}
                          </p>
                        )}
                      </div>
                      <p className="text-sm text-gray-500">
                        {new Date(transaction.created_at).toLocaleString()}
                      </p>
                    </div>
                  </div>
                  <div className="flex items-center">
                    <p className={`text-sm font-medium ${getStatusColor(transaction.amount)}`}>
                      {parseFloat(transaction.amount) >= 0 ? '+' : ''}
                      {parseFloat(transaction.amount).toFixed(8)} {transaction.wallet?.currency || 'N/A'}
                    </p>
                  </div>
                </div>
                {transaction.metadata && Object.keys(transaction.metadata).length > 0 && (
                  <div className="mt-2">
                    <p className="text-xs text-gray-400">
                      Metadata: {JSON.stringify(transaction.metadata)}
                    </p>
                  </div>
                )}
              </div>
            </li>
          ))}
        </ul>

        {filteredTransactions.length === 0 && (
          <div className="text-center py-12">
            <p className="text-gray-500">No transactions found</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default Transactions;
